import './App.css';
import Hero from './components/Hero';
import Navbar from './components/Navbar';

function App() {
  return (
    <div>
    <h1 className="text-3xl font-bold underline">
    Hello world!
  </h1>

    <Navbar/>
    <Hero/>
  </div>
  );
}

export default App;
